import Api from "./Api";


function ProductCardList(items) {
    return (
        <div>
            <img src={items.images} alt={items.tags} />
            <div>
                <h3>{items.name}</h3>
                <p>{items.price}</p>
                <p>{items.favoriteCount}</p>
            </div>
        </div>
    );
}

function ProductCard({ items }) {
    return (

        <ui>
            {items.map((items) => (
                <li key={items.id}>
                    <ProductCardList items={items}/>
                </li>
            ))}
        </ui>
    );
}

export default ProductCard;
